import styled from "styled-components";

const Topbar = styled.header`
    width: 100%;
    height: 50px;
    background-color: #000;
    color: #fff;
`;

export default function Header({
    children,
}) {
    return (
        <Topbar>
            {children}
        </Topbar>
    );
}
